import React from 'react';

import SearchIcon from '@mui/icons-material/Search';
import PersonIcon from '@mui/icons-material/Person';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import IconButton from '@mui/material/IconButton';
import { Avatar, Badge, Menu, MenuItem } from '@mui/material';
import './Navbar.css';
import { useNavigate } from 'react-router-dom';
import { pink } from '@mui/material/colors';
import { useDispatch, useSelector } from 'react-redux';
import { useState } from "react";
import { logout } from "../../State/Authentication/actions.js";


export default function Navbar() {
    const navigate = useNavigate();
    const dispatch = useDispatch();

    const { auth } = useSelector(store => store);
    // console.log("auth", auth);

    const [anchorEl, setAnchorEl] = React.useState(null);
    const open = Boolean(anchorEl);

    const handleOpenMenu = (event) => {
        setAnchorEl(event.currentTarget);
    }

    const handleCloseMenu = (event) => {
        setAnchorEl(event.currentTarget);
    }

    const navigateToProfile = (evene) => {
        auth.user?.role === "ROLE_ADMIN" ||
            auth.user?.role === "ROLE_RESTAURANT_OWNER" ?
            navigate("/admin/restaurants") : navigate("/my-profile");
    }

    const handleCloseAuthModel = () => {
        navigate("/");
    }

    const navigateToHome = () => {
        navigate("/");
    }

    const handleLogout = () => {
        dispatch(logout());

    }


    return (
        <div className='navbar sticky top-[0] w-full  px-5 z-50 py-[.8rem]
             bg-[#e91e63] lg:px-20 flex justify-between' >

            <div className='lg:mr-10 cursor-pointer flex items-center space-x-4'>
                <div className='logo font-semibold text-grey-300 text-2xl' >
                    CraveKart
                </div>
            </div>

            <div className='flex items-center space-x-2 lg:space-x-10'>
                <div>
                    <IconButton onClick={()=>navigate("/search")}>
                        <SearchIcon sx={{ fontSize: "1.5rem" }} />
                    </IconButton>
                </div>

                <div className="flex items-center space-x-2">    
                    {
                        auth.user?.fullName ? (
                            <span>
                                <Avatar>
                                    { auth.user.fullName[0].toUpperCase()}
                                </Avatar>
                            </span>
                        ) : (
                                <IconButton onClick={()=>navigate("/account/login")}>
                                    <PersonIcon sx={{fontSize: "2rem"}}/>
                                </IconButton>
                        )
                    }
                    <Menu
                        id="basic-menu"
                        anchorEl={anchorEl}
                        open={open}
                        onClose={handleCloseMenu}
                        MenuListProps={{
                        "aria-labelledby": "basic-button",
                        }}
                    >
                        <MenuItem
                        onClick={() =>
                            auth.user?.role === "ROLE_ADMIN"
                            ? navigate("/admin")
                            : navigate("/super-admin")
                        }
                        >
                        Profile
                        </MenuItem>
                        <MenuItem onClick={handleLogout}>Logout</MenuItem>
                    </Menu>

                    <IconButton className=''>
                        <Badge badgeContent={4} color="secondary">
                            <ShoppingCartIcon sx={{ fontSize: "1.5rem" }} />
                        </Badge>
                        </IconButton>
                </div>
            </div>

        </div>
    )
}
